id = "RN048"
question = "Vad kan AI-användning i kreativa marknadsföringsprocesser leda till hos konsumenter?"
answer = "Det framstår därför som att användandet av AI inom kreativa processer inom marknadsföring kan ligga till grund för oroligheter och osäkerheter hos konsumenterna, där AI upplevs som något obekant och ibland hotfullt"
